import React from "react";
import styles from "./SectionsContainer.module.css";
import Icons from '../../assets/icons/icons';
export default function Section2(){
    const boxes = ['Płyty gipsowe','Izolacje i styropian','Stelaże do płyt gipsowych',
    'Wszystkie rodzaje okien','Drzwi zewnętrzne','Kleje, pianki farby i inne'];
    const listItems = boxes.map((box) =>
    <ListItem value={box} />
  );
    return(
        <div class="container" style={{position:'relative', paddingBottom:'100px'}}>
            <div class="row">
            <div class="col-md-4">{listItems}</div>
            </div>

        </div>
    )
}
function ListItem(props) {
    const value = props.value;
    return (
      <div class="orange-container">
 <div key={value.toString()}>
        {value}
      </div>
      <Icons icon="blacksquare" width='20' height='20'/>
      </div>
     
    );
  }
